import React, { useState } from "react";
import Navbar from "../../components/Navbar";
import Footer from "../../components/Footer";
import ServiceForm from "./ServiceForm";
import { Link } from "react-router-dom";

const EditService = () => {
  const [message, setMessage] = useState("");
  return (
    <>
      <Navbar />
      <main className="p-[4rem]">
        <section className="p-[4rem] grid justify-center items-center">
          <div class="row">
            <Link to="/services">
              <i class="fas fa-arrow-left"></i> Services
            </Link>
          </div>
          <h1 className="title">Edit Service</h1>
          <p className="message">{message}</p>
          <form
            action="/services/<%= service._id %>?_method=PUT"
            method="POST"
            className="flex flex-col justify-center items-center w-[90vw]"
          >
            <ServiceForm />
          </form>
        </section>
      </main>
      <Footer />
    </>
  );
};

export default EditService;
